package hakerrank.interviewprep.strings;

import java.util.HashMap;
import java.util.Iterator;

/**
 *
 * Sherlock and the Valid String*/

public class ValidString {

    public static void main(String[] args) {
        String st = "aabbccddeefghi";
 StringBuilder boulder = new StringBuilder();
 boulder.append("").append("").append("").append("").append("").append("").append("").append("gbbgbghddfdcfcbbbfdbbdiidhifbedfehbicgihaehiagedfeggcgafbhbdiabdcggiecificceeideebfabgfgihbifdefieefcdaieifaaefdfcbfaacicihgb" +
         "").append("").append("").append("");


 System.out.println(isValid(boulder.toString()));

    }

    static String isValid(String str){

        HashMap<Character,Integer> map = new HashMap<>();

        char[] arr = str.toCharArray();

        for(char c:arr){
            Integer freq= map.get(c);
            freq = freq == null ?1:++freq;
            map.put(c,freq);
        }
         Iterator<Character> it =   map.keySet().iterator();

        int frequency = -1;
        int change =0;
        int allowedChange=1;
        boolean no =false;

        while(it.hasNext()){
            Character key  = it.next();
            Integer value = map.get(key);
            System.out.println(String.format("%s:%d",key,value));
            if(frequency == -1){
                //first time
                frequency=value;
            }else{
                int diff = value> frequency ? value-frequency:frequency-value;
                change+=diff;
            }
            if(change > allowedChange)
            {
                no = true;
                break;

            }
        }

        return (no)?"NO":"YES";
    }
}
